script: |
  super -f text -I q7894.spq | sort > q7894.out

inputs:
  - name: q7894.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 - - col2 IN ( 85 + - col0 + + 81 * col2 * - - 80 + - col0 + col2, col1 / + ( - col2 ) );
  - name: tab1

outputs:
  - name: q7894.out
    data: |
      51	14	96
      85	5	59
      91	47	68
